import React from 'react';

function Entry() {
  return (
    <div className="body">
      <div className="left-image">
        <img src="/images/left_image.png" alt="Left Image" />
      </div>
      <div className="right-image">
        <img src="/images/right_image.png" alt="Right Image" />
      </div>
      <div className='block'>
        <div className='enter_name'>
            <input type='text'/>
        </div>
      </div>
    </div>
  );
}

export default Entry;
